"description": "Whiskey Stones are a Unique and Popular gift on their own, but when they are personalized they become extra special.\n\nThis listing is for 4 sets of 4 Engraved Whiskey Stones in a personalized wood box.  This makes a great gift for Weddings, Christmas, Stocking Fillers, Birthdays, Anniversaries, Military Weddings, Whiskey Stones are always are well received gift.\n\nEach Whiskey Stone measures 1.15&quot; x 1&quot; and is made of 100% Soapstone right here in the USA. Only 2 or 3  are needed per drink.  Each set comes in it&#39;s own Muslin Storage bag with an instructions for use card.  \n\n**You can choose between 2 colors for the Gift Box, Jacobean (Rustic Brown) or Ebony**\n\nThis gift set is fully customizable so I can engrave anything on the Stones and Box, just send me your engraving instructions in the &quot;Notes to Seller&quot; section at check out or send me an Etsy Convo.\nSome font examples can be seen in the item pictures.  \n\n**What are Whiskey Stones?**\n\nWhiskey Stones, are a new way to chill your whiskey or wine without diluting your drink. Ice cubes water down your whiskey and leave a moist layer of condensation on your glass, whiskey stones have all the benefits of ice without the hassles.\n\nWhiskey Stones are made out of cubes of solid soapstone which is softer than granite and won’t scratch your glass. Soapstone retains its temperature much longer than ice, so it will cool your whiskey or liquor of your choice and provide a more sustained chill. Whiskey Stones are also non-porous, odorless and tasteless so they won’t alter your favorite drinks. Whiskey Stones can also be used to warm your drinks and work well with non-alcoholic beverages too.\n\nStill thinking and in need of more ideas?  Check out my shop via the link below for more great gifts for Men.  I add new items weekly so please Favorite my shop so you are the first to see the new arrivals.\nhttps://www.etsy.com/shop/TheUltimateManShop\n\nI currently have active listings for the amounts shown below, simply click the link for the quantity you require.  If you need more than is shown, please let me know and I will create a custom listing just for you.  \n\n1 Set - \nhttps://www.etsy.com/listing/219862634\n2 Sets - \nhttps://www.etsy.com/listing/219864162\n3 Sets -  \nhttps://www.etsy.com/listing/219866609\n4 Sets - \nhttps://www.etsy.com/listing/219867117\n5 Sets - \nhttps://www.etsy.com/listing/219867635\n6 Sets -\nhttps://www.etsy.com/listing/219868003\n7 Sets - \nhttps://www.etsy.com/listing/219868317\n8 Sets -\nhttps://www.etsy.com/listing/219868661\n9 Sets -\nhttps://www.etsy.com/listing/219867182\n10 Sets -\nhttps://www.etsy.com/listing/219869163",
