"title": "Will You Be My Groomsman - Bridesmaid - Best Man - Whiskey Style Labels - Ask Groomsman - OR Groomsman Gift - Wedding Party - Set of 6",
"description": "Ask or thank your Groomsmen & Best Man in this unique way – with custom whiskey labels!\n\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nTO CUSTOMIZE YOUR LABELS\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nAt checkout, please include the following in the NOTES TO STUDIOBLABELS:\n\n1. First Name of BEST MAN \n2. First Names of GROOMSMEN\n3. Your married LAST NAME\n4. Wedding DATE/or season/year if not yet determined\n5. Wedding LOCATION (city, state or country)\n6. FIRST INITIALS of Bride and Groom (initials in the order you prefer on label)\n7.* FIRST NAME of Groom (for Groom label if extra available)\n\nSelect LABEL PURPOSE from the drop-down menu at checkout:\n1. Be my Groomsman/Best Man?\n2. Thank you for Being My…\n3. Title Only such as “Groomsman” “Best Man” or “Usher”\n\nSelect TOTAL LABEL QUANTITY from the drop-down menu at checkout. Labels are printed 6 to a sheet and the price is the same for 6 or less.  Fun extras, generics or duplicate labels are always sent to reach the minimums.\n\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nABOUT THESE LABELS\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nThese labels come in a set of 6 (SIX), professionally printed on weatherproof semi-gloss stock.  Each individual label measures 3.33” wide x 4” tall, perfect for 375 mL flask bottles.  They also fit the large 750 mL bottle, however the label is slightly smaller than the original.\n\nThe labels read:\nNAME\nFIRST INITIALS OF BRIDE AND GROOM\nWEDDING YEAR\nBE MY Groomsman/Best Man? OR THANK YOU for being my Groomsman/BM OR Groomsman/Best Man/Usher (etc)\nDATE • LOCATION\nTHE (LAST NAME) WEDDING PARTY\n\nFor the ladies too! Just please note this on your order along with bridesmaids, Maids/Matrons of Honor, etc.\n\nProofs are available by request only.  Please note a PROOF REQUEST on your order notes at check out!  Proofs are typically sent via Etsy Messages 1 day prior to shipment.  Failure to approve proof may delay shipment.\n\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nSHIPPING\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nUS STANDARD: Typically 6-8 business days to your door from placing order\nPRIORITY: Typically 5-6 business days to your door from placing order\nRUSH: Next day turnaround with PRIORITY shipping. Typically 3-4 business days to your door. \nEXPRESS: Next day turnaround with EXPRESS shipping. Typically overnight or 2nd day service (varies on location) and is the only shipping option that is guaranteed by USPS. \n\nA tracking number will be sent upon shipment and details regarding your shipping date can be viewed on your &quot;Purchases&quot; page. For additional shipping information, including international shipping times, please see Shipping Section on shop Policies Page.  USPS does experience rerouting and delays from time to time. Standard International delivery is typically 2-3 weeks.  Need this order RUSHED??! Purchase expedited printing and shipping from the drop down at check out!\n\nEach line can be customized as requested based on fitting. Custom requests must be made IN CAPS in a separate sentence with as much detail as possible.\n\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nOTHER IMPORTANT INFO\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\nThe old labels definitely look best removed and it’s pretty simple to do! Complete instructions come with each order.\n\nPlease read shop “Policies” for more information.\n\nSadly whiskey is not included. This listing is for labels only. :)\n\nA gift not soon forgotten! Happy Wedding Planning!",
