"policy_welcome": "Welcome to ShaysRevival shop! Handpicked vintage jewelry, home decor, housewares and toys or anything vintage that catches my eye!\r\nPlease read below to learn about our shops policies...\r\n",
"policy_payment": "We accept payment only through PAYPAL (you can pay by credit card through paypal as well). Payment is due immediately unless you have messaged BEFORE buying and okayed it with us, in which case payment is due within 5 days.",
"policy_shipping": "Most items are only offered to US customers and are carefully packed before shipment.\r\n\r\nFor U.S buyers we try to  ship via USPS priority mail including shipping confirmation.\r\nU.S buyers: look for shipping quote under each listing. Some items due to size and shipping costs may use another shipping method and will be noted in the ad.\r\n\r\n\r\nInternational buyers: all items are shipped via International First Class Mail, and generally take 5-10 days to arrive.  NOTE: due to the high cost of international shipping, please convo me and I will get a quote to you before purchase.\r\n\r\nInternational:\r\nPlease keep in mind that international orders can in rare cases take up to a month or two to arrive depending on which country they are going to, and the customs policies. Sometimes your packages are waiting for you at your local post office, or being held up in customs. If your package is lost for some reason, you will receive store credit or an immediate exchange for the amount of the lost item. I cannot afford to refund money every time an international package takes too long to arrive. Please be patient in waiting for your orders.\r\n***Insurance in case a package is lost or damaged can be added to a package for an additional $12. If this is not added to a package, we are not responsible if your order is lost or damaged in the mail.\r\n",
"policy_refunds": "Returns will only be accepted if the item was greatly misrepresented. If this is the case, exchange or store credit will be issued. We do not do returns for items that do not fit, so please double check the measurements, and message us if you have any questions! If you have any problems with your purchase, let&#39;s work it out! =)\r\n\r\nPlease remember that most of our items have been previously worn and loved, and may show signs of wear. We do our absolute best to list any imperfections.\r\n\r\nWe want all our customers to be happy with their experience so please contact us if there are any problems, and we will do our best to make it right.\r\n\r\n*** ALL SALE ITEMS ARE FINAL SALE. ",
"policy_additional": "Buyers are responsible for keeping an updated address attached to both their etsy and PayPal accounts. We are not responsible for shipping to the wrong address, if it was not changed prior to purchase.  Re-shipment due to erroneous mailing address will incur additional charges to be paid by the customer.\r\n\r\nMessage us if you are interested in us holding an item for you!\r\n",
