"accepts_custom_requests": true,
"policy_welcome": "Welcome to Thunder Moon Supplies. This grew out of Thunder Moon Creations. We started by selling Jane&#39;s favorite Flush Cutters there and soon realized that the supplies needed their own site.\r\n\r\nWe do not use generic photos! We believe that you should see what you are buying. If a listing is for 18 gauge wire, we have a photo of the 18 gauge wire just as you will receive it. It just makes sense to us to show you what you are buying and not generic or inaccurate photos.\r\n\r\n\r\nWe hope you agree.",
"policy_payment": "You can pay using your credit card through Etsy&#39;s direct checkout. It is easy, safe, and secure. You can also pay via PayPal.\r\n\r\nIf you choose the eCheck option in PayPal it takes 3-4 business days to clear.",
"policy_shipping": "We keep our items in stock for immediate shipment. We usually ship within 1 to 2 days of receipt of payment. If there is a reason why your shipment will be delayed we will let you know via convo.\r\n\r\nAll orders are sent via USPS first class mail in inside a padded envelope or USPS Flat Rate Priority Mail boxes. We ship to the address listed in your Etsy order.\r\n\r\nDelivery confirmation through the Post Office is included on all orders. When your order is shipped, we will send an email to the address as provided with your PayPal account or as provided via Etsy Direct Checkout.\r\n\r\n♥ International Shipping:\r\nWe ship first class air mail, and the International Shipping cost is an average of places to which we ship. If the actual cost is more, we&#39;ll contact you with the amount and get your &quot;okay&quot; before we ship.\r\n\r\nWe are not responsible for any duty or customs fees that may be charged to you. We cannot be responsible for lost international shipments, unless you specifically paid to have the shipment insured. We can quote shipping insurance upon request.\r\n\r\nA Note About Wire\r\nWire is heavy. The more you buy the heavier it is. Still, it is much more economical for you to buy as much wire as you can at one time. This cuts down on your overall shipping cost, which cuts the cost you pay for your wire. \r\n\r\nOnce you get above 12 or 13 ounces, it is better to use the Priority Mail small box or the new larger Regional Rate boxes. They have flat rates and have no weight limit if shipped within the USA.\r\n\r\n",
"policy_refunds": "We want you to be delighted with your purchase. If you are unhappy for any reason, contact us and we will make it right.\r\n\r\nWe reserve the right to charge a restocking fee of 15% on all returned items. Some custom cut leathers and wire may not be returnable.\r\n\r\nPlease take a look at our feedback to see how we treat our customers. We love our customers and treat each on as if they were our only customer.",
"policy_additional": "If there is something you want that you don&#39;t see, drop us a line. Maybe we can get it for you.",
