"description": "Product Details:\n\nThis engravable decanter set is an absolute must-have for any gentleman who loves whiskey or any other well made spirit. Perfect for the after work drink to wind down and even the small occasional dinner party. Made of 100% glass, the decanter holds 34oz of your favorite beverage and can be personalized with your initial. The rock glasses are uniquely square-like shaped to provide a more enjoyable drinking experience and are personalized with your initial as well. \n\nSet Includes 1 Decanter and 4 Rock Glasses\n\nAll 5 pieces come engraved with a single initial of your choosing. \n\nDecanter Size: 9&quot; (H) x 3-1/2&quot; (W); holds 34 oz.\n\nRock Glass Size:  3-1/2&quot; tall; holds 9-1/4 oz.\n\nFeatures: Beveled stopper\n\nMaterials: Clear glass\n\nPlease Note: With machine-crafted blown glass, expect minor bubbles and swirls that are inherent to the glass. Variations will occur on styles due to their machine-crafted nature.\n\n\nPersonalization:\n\nLet us make your special item even more memorable with FREE custom personalization. Personalization options for Decanter and Rock Glass Set are available in Last Name with Single Initial on the decanter and Single initial on each of the four rock glasses in the font style shown in image. \n\nPlease provide  Last Name with Single Initial to be engraved on Decanter as well as Single Initial to be engraved on the Rock Glasses  in the &quot;Notes to Seller&quot; section, if applicable. \n\n\nShipping: \n\nAt this time we do not ship Internationally.  \n\nHawaii and Alaska customers please contact us to place order. \n\nOrders typically arrive within 3 to 5 business days once they leave our store via FedEx. Some items are eligible for upgraded shipping and will be specified in the listing. Shipping times do not include the time it takes to make and prepare the order for shipping. Order preparation/handling varies by item. Please see details under Shipping and Policies tab. \n\n\nGuarantee:\n\nWith our “No Worries” 100% Satisfaction Guarantee , we offer complete peace of mind. Discover an extraordinary selection of personalized gifts, distinctive accessories, the newest ideas, and everything you need to make your purchase uniquely special.\n\n\nReturns:\n\nIt is my goal to make sure that you are satisfied with your purchase. If for any reason you are not happy with your order please let me know and I will do everything to make things right. If we are unable to come to an equally beneficial solution I am more than happy to issue a complete refund for your entire order.",
