"title": "18k Yellow Gold Ring with Offset Meteorite Stripe and Jack Daniels Whiskey Barrel Wood Sleeve",
"description": "With a gleaming outer shell this meteorite and 18k yellow gold ring is bound to have heads turning. Another conversation piece is the natural wood sleeve made from a genuine Jack Daniels Whiskey Barrel.  All of the materials come together magnificently in this special ring. The Gibeon Meteorite&#39;s pattern and natural wood grain will never be alike so you know you will be getting a one-of-a-kind handmade piece every time.\n\nAll of my wood rings are coated with ring armor. The ring armor service is very durable and will protect the wood from water, UV rays, nicks and scratches.\n\nDETAILS OF THE RING\nRing Width: 6 mm\nRing Sleeve: Jack Daniels Whiskey Barrel\nRing Profile: Round\nRing Finish: Polished\n\n1 mm 18k Yellow Gold\n2 mm Gibeon Meteorite\n3 mm 18k Yellow Gold\n\nThe listed price is a starting point only. Your Ring Size and Ring Width of will determine the actual price. The metal prices are linked to the World Metal Market Prices and change frequently during the day every day.\n\nAvailable Ring Sizes: 4 to 16, including 1/4, 1/2 and 3/4 sizes\nAvailable Ring Widths: 4 mm to 12 mm\n\nAll of my wooden rings have a comfort fit.\n\nRING FITTING\nWe highly recommend that you get your ring size in a COMFORT FIT measured by reputable jewelers UNTIL at least 2 agree on the same size (law of averages). To ensure we will be making your ring the proper fit, please read the following links: \njewelrybyjohan.com/how-to-get-your-ring-sized-properly/\njewelrybyjohan.com/how-to-measure-a-ring/\n\nThese 18k yellow gold rings are not re-sizable.\n\nRING SIZE\nLeave a note in the &quot;Message to Shop&quot; box DURING CHECKOUT with your Ring Size, Ring Width and Date Needed. Please contact us about information on rush orders.\n\n&gt;Please read the shop policies page for the RETURNS/REFUNDS policy. You can find the shop policies here:   http://www.etsy.com/shop/jewelrybyjohan/policy\n\n&gt;Please read the shop policies before placing your order, primarily to see the current TURNAROUND TIME. You can find the shop policies here:  http://www.etsy.com/shop/jewelrybyjohan/policy\n\n&gt;You can find my profile page here:  http://www.etsy.com/people/jewelrybyjohan\n\n&gt;If you have ADDITIONAL QUESTIONS or SPECIAL REQUESTS, please contact me here:  http://www.etsy.com/convo_new.php?to_username=jewelrybyjohan\n\nCelebrate with style,\nJohan Rust\n\nhttp://www.jewelrybyjohan.etsy.com\n\nMETEORITE QUALITY\n***Meteorites are almost never &quot;perfect.&quot; Their imperfections are one of the things that make them unique and beautiful. Please expect that there might be small imperfections/marks/inclusions visible in the meteorite. IF YOU PREFER A PERFECT METEORITE, please visit this listing, where it is available for purchase: \nhttps://www.etsy.com/listing/169100646/to-purchase-perfect-meteorite-for-your?ref=shop_home_active_1&ga_search_query=perfect",
