"sale_message": "Thank you for your purchase, we will message you via Etsy within the next few days with your estimated ship date, DO NOT use the Etsy auto generated shipping date, please view our policies page for the current turnaround time.\r\n\r\nSign Up for our Newsletter!\r\nhttp://eepurl.com/bBRfEn\r\n\r\nIMPORTANT: Your ring will go into production within 3 business days your order confirmation. If you would like any changes made to your order, please submit them within the next 3 business days. Any changes requested after this time may result in restocking fee and/or delay in shipment. \r\n\r\nDETERMINE YOUR RING SIZE\r\nEtsy does not provide an area where I can post a write-up, with pictures, so I decided to provide you with a link to my blog that have pictures and instructions:\r\nhttp://jewelrybyjohan.com/category/information-ring-ordering/\r\n\r\nIF YOU PURCHASE A RING SIZER\r\nIf you purchase a sizer along with your custom ring please note that your custom ring will not start production until you confirm your size. Once we receive your size confirmation your custom ring will be scheduled according to the present turn around time of size confirmation. \r\nhttps://www.etsy.com/listing/81245623/ring-sizer-custom-made-to-order-1000?ref=shop_home_active_3\r\n\r\nENGRAVING\r\nPlease purchase engraving here if you are interested: https://www.etsy.com/listing/122036427/laser-engraving-service-text-only?ref=shop_home_active\r\n\r\nPOSITIVE FEEDBACK\r\nIf you like my rings, leave me positive feedback on Etsy and tell your friends.\r\n\r\nNEGATIVE FEEDBACK\r\nPlease don&#39;t leave me Negative feedback without contacting me before the time. Contact me so that we can sort out and fix the problem.\r\nI care about my clients, I will always help you.\r\n\r\nINSURANCE/ SIGNATURE DELIVERY\r\nIf you would like to purchase shipping insurance please view the link below and from the drop down menu please select your order value. The shipping insurance would cover the full cost of the ring in the event it is lost or stolen during transit.\r\n\r\nhttps://www.etsy.com/listing/181284550/usa-shipping-upgrade-after-purchase?ref=shop_home_active_2\r\n\r\nhttps://www.etsy.com/listing/183942258/international-shipping-insurance?ref=shop_home_active_6\r\n\r\nInternational Duties- Buyers are responsible for duties. \r\nShipping internationally will go smoothly most of the time. Every so often a package can get stuck in customs please be aware that Jewerly By Johan can’t be held  responsible for custom delays. We will do everything in our power to help expedite any issues.\r\nAny orders shipping international will need to upgrade to FedEx if the order value is more than $400.00.\r\n\r\nALL SALES ARE FINAL.\r\nNo cash refunds are given, an in-store credit will be issued.\r\n\r\nPlease accept this message as an acknowledgment that I did receive your order.\r\n\r\nRegards,\r\nJohan.\r\n\r\n(This is an automated response that Etsy sends out to you the buyer after every sale as an acknowledgement of your purchase)",
