"description": "This listing is for 1 set of 4 Large engraved Whiskey Stones / Rocks in a Personalized Square wood box.  Whiskey Stones are a new cool way to chill your beverage without diluting it as ice does when it melts (please see full description below).  The Whiskey stones are 100% soapstone and are cut and engraved right here in the USA.\n\nThese rocks and box make a fantastic personal gift for every whiskey lover in your life.  They are perfect for Grooms Party gifts at weddings (Groomsman / Groomsmen / Best Man / Father of the Bride or Groom), Christmas, Birthdays, Father&#39;s Day, Retirements, Promotions, Anniversaries and more!\n\nIncluded in the set are -\n\n4 Large Custom engraved Whiskey stones measuring 1.15&quot; x 1&quot;\n1 Custom engraved wood box measuring 3.5&quot; x 3.5&quot;\n1 Muslin cotton storage bag \n1 Instruction Card\n\nI can engrave anything on the stones and the wood boxes.  The pictures gives you some ideas but the stones and box can be fully customized.  Some of the more popular engravings are -\n\n* Names\n* Dates\n* Monograms\n\nIf you would like to purchase these engraved whiskey stones and wood box please leave any engraving instructions in the &quot;Notes to Seller&quot; section at check out.  You can choose between 4 different colors of box,  Ipswich Pine, English Chestnut, Red Oak and Ebony.  Some font examples can be seen in the item pictures, the font used in the main picture is AR Julian.\n\n**What are Whiskey Stones?**\n\nWhiskey Stones, are a new way to chill your whiskey or wine without diluting your drink. Ice cubes water down your whiskey and leave a moist layer of condensation on your glass, whiskey stones have all the benefits of ice without the hassles.\n\nWhiskey Stones are made out of cubes of solid soapstone which is softer than granite and won’t scratch your glass. Soapstone retains its temperature much longer than ice, so it will cool your whiskey or liquor of your choice and provide a more sustained chill. Whiskey Stones are also non-porous, odorless and tasteless so they won’t alter your favorite drinks. Whiskey Stones can also be used to warm your drinks and work well with non-alcoholic beverages too.\nThe Whiskey Stones are Dishwasher safe.\n\nStill thinking and in need of more ideas? Check out my shop via the link below for more great gifts for Men. I add new items weekly so please Favorite my shop so you are the first to see the new arrivals.\nhttps://www.etsy.com/shop/TheUltimateManShop",
