"is_vacation": false,
"vacation_message": "Hi there, thank you for stopping by, currently The Ultimate Man Shop is closed for Christmas Vacation whilst I am out of the country.  Thank you very much for your interest, all listings in the shop will be available again from January 9th 2015.  \r\n\r\nHave an awesome winter vacation!\r\n\r\nKindest Regards, \r\n\r\nJoe \r\nThe Ultimate Man Shop",
"sale_message": "Thank you for shopping with The Ultimate Man Shop.  Your order is confirmed and we will contact you if there are any questions with regards to the engraving instructions.\r\n\r\nYour custom order will be made and posted ASAP.  \r\n\r\nWith Best Wishes,\r\n\r\nJoe, Richard, Samantha and Lily the Dog.\r\n(The Ultimate Man Shop Team)",
"digital_sale_message": null,
"last_updated_tsz": 1445720835,
