"policy_welcome": "I am so glad that you have chosen to visit my shop!  I try to have items in my shop that I genuinely enjoy, and believe that others will enjoy as well.  All items have been carefully chosen, and I have checked them over to the very best of my ability.  I try to fully disclose any blemishes.  I want you to be happy with each and every purchase you make in my shop.  Thank you for doing me the honor or taking your time out to look at my offerings!",
"policy_payment": "I accept PayPal and direct Etsy checkout.  When it&#39;s convenient for you, I prefer Etsy direct checkout.  Payment is due when you purchase an item.  Until an item is paid for, it remains available to other buyers, so if you have items in your cart that are near and dear to your heart, please proceed to checkout at your earliest convenience to avoid disappointment.\r\n\r\nIf you order something by mistake, or change your mind after choosing an item from my shop, please be considerate of other shoppers and let me know right away, so that I can cancel the sale, and make the item available to them once again.  Once an item has been shipped, the sale cannot be cancelled until the item is returned to my shop.",
"policy_shipping": "Etsy has now gone &#39;live&#39; with an interactive shipping calculator, so shipping costs for items can be calculated directly from the listing.  I am in the process of updating my listings to enable this feature for all listings, but this may take some time, so please be patient with me.  The new system is wonderful, but it&#39;s not perfect.  For instance it cannot take into account items that can be stacked or placed inside each other, such as bowls or plates.  If you are buying plates or bowls, or other items which stack well or fit inside each other for shipping, it is very likely that shipping will cost less than the amount the shipping calculator quotes to you.  It is not my intention to make money on shipping, and I charge only the actual cost of packaging and shipping.  It is my policy to refund to the buyer any shipping overcharge that exceeds one dollar.\r\n\r\nIf you believe the shipping calculated for a particular item is in error, please take a moment to send me a message, and I&#39;ll check into it.\r\n\r\nI generally ship by FedEx Ground Home Delivery or USPS Priority, whichever is less expensive.  If your address is a post office box, FedEx cannot deliver to you, and I will then ship by USPS Priority.  In cases in which your package is particularly large and/or heavy, USPS Parcel Select may be a more economical, albeit slower method.  There is, of course, no charge for local pickup.  If you prefer a particular shipping method, I will do my best to accommodate your wishes.",
"policy_refunds": "I will gladly refund your purchase price for any item you change your mind on, but the buyer is responsible for return shipping in original condition, and the refund does not include original shipping.\r\n\r\nIf, however, an item is substantially different from the description, I will refund all monies paid.",
"policy_additional": "If you are perusing my listings and you run across something that you believe is wrong in my description, or if you have additional information about anything I&#39;m offering for sale, I would be most grateful if you would message me about it.",
