"login_name": "WildWoodBarkArtisan",
"accepts_custom_requests": false,
"policy_welcome": "Welcome to Wildwood Bark Art...We appreciate you stopping in for a visit! \r\nFrom reclaimed barn wood to fallen White Birch bark, you will find a little piece of Mother Earth in all our pieces. We love nature, the outdoors and the elements and honor all it bestows upon us. We also love vintage rustic decor items and have a wonderful Vintage section for you to peruse. \r\n\r\nWe hope you enjoy looking through our shop and feel free to contact us with any questions you may have.\r\n\r\nCheers~",
"policy_payment": "Direct Checkout and Paypal are accepted. Please process your payment promptly so I can ship your item quickly. All items are shipped within 1-3 business days upon payment confirmation.\r\n\r\nIf you change your mind please let me know so I can cancel the order and re-list the item.",
"policy_shipping": "All our orders ship absolutely FREE to you! All orders ship via FedEx, USPS Priority or Standard USPS on items under 13oz..\r\n\r\nOrders will be shipped to the address you have on file with Etsy/Paypal. Please check it prior to submitting an order! Anything returned to us or lost due to an incorrect address will result in new shipping charges, which will be the responsibility of the buyer.\r\n\r\nI am responsible for packages not delivered and will do everything I can to track the package and resolve any shipping issues. All of my items are shipped with tracking info. so please contact me so I can make sure everything arrives in a timely manner. If tracking through USPS says package was delivered and you as the customer are stating it was not I follow all guidelines as outlined through USPS which includes filing a theft report. Please make sure packages were not delivered to a neighbor or someone within household accepted delivery. I will do everything I can to track your package with USPS. The same goes when we ship FedEx.\r\n\r\n*** U.S. customers if you have not received your item(s) within 10 days after I have shipped please contact me so I can start tracking and resolving any issues. ",
"policy_refunds": "If for ANY reason you are not completely satisfied you can return your purchase within 7 days of receipt. Refunds will be made in the same manner as your payment. Items must be returned unworn/unused and in the original packaging.\r\n\r\nRefund options:\r\n1. Return the item in new, unworn condition and original packaging for a full refund (less shipping costs).\r\n\r\n2. Exchange your item. Price differences (credit or debit) will be processed through the manner in which you originally paid.\r\n\r\n*Unfortunately custom pieces cannot be returned. ",
"policy_additional": "Please convo us if you are interested in a custom order. We love to be creative and would enjoy brainstorming with you to see if we can design a piece that fits what you are looking for!",
