"title": "Apple Watch Double Wrap Band Strap (Whiskey Brown) | Full Grain Vegetable Tanned Leather | Made in USA",
"description": "Show off your Apple Watch with this beautiful, handcrafted leather double wrap band that&#39;s made in USA. This watch band is made with full grain vegetable tanned leather from one of the oldest tanneries in the US. We handcraft this watch band in the heart of Texas and most of the materials are sourced from the US. We hand stitch our watch band using a time-honored saddle-stitch method which is much stronger and longer lasting than the &quot;lock-stitch&quot; method used with sewing machines. \nThis leather double wrap band can be worn two different ways: double-sided on one side (left or right) or double sided between the watch face. This wrap watch band is made in Texas and sourced from materials right here in the US (aside from the Apple Watch adapter).\nThe Apple Watch leather wrap will beautifully age with character over time due to the full-grain leather.\n\nLeather Color - Whiskey Brown\nBuckle/Loops Color - Antique Brass, Polished, or Black (PVD coated)\n\nFeatures\n\n• English bridle full-grain vegetable tanned leather (~4-5oz.)\n• Hand burnished edges\n• Waxed polyester thread (hand saddle stitched)\n• Hand cut & sewn design\n• Stainless steel Apple watch adapter\n• Solid brass buckle and loops\n• Handmade in Texas\n\nSize\nThis Apple Watch Double Wrap Band fits wrist sizes from ~135mm to ~165mm (the average sizes for most small/medium women&#39;s wrists). Please check your wrist size before ordering.\nThis watch band is made of vegetable tanned full grain leather, please expect the band to have an initial tight/stiff fit. The band will break-in over time and feel like it was custom fitted to you!\n\n\nApple Watch Adapter\nThe included stainless steel Apple Watch adapters come in three options: Black, Silver, or Gold\nWe recommend the following adapters to match the Apple Watch model you have:\nSpace Grey Sport - Black adapter\nSpace Black SS - Black adapter\nAluminum Sport - Silver adapter\nStainless Steel - Silver adapter\nRegular Gold Sport - Gold or Black adapter\nRose Gold Sport - Gold or Black adapter\n\n\nBecause these watch bands are handmade, it may take up to 5 business days before it&#39;s shipped to you.\n\nThis product is made of full grain leather and some marks or scars may be present on the leather. Due the variations in leather color, computers monitors, etc. the leather color may appear up to 20% different than the product photos.\n\n*The Apple Watch shown in the photos is not included, this listing is for the watch band and adapter only*",
