"description": "Want an original way to ask the guys to be a part of the big day? Here it is!\n\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -\n\nHERE’S WHAT YOU GET:\n\n-A professionally printed bottle label in the designs as shown. Each label is customized with your details, then printed and shipped right to your door. \n\n- Label can be placed on a wine bottle, square whisky bottle such as Jack or Jim Beam, or Fireball. \n\n- Our standard labels are printed on white stock matte label paper and are not weatherproof, we offer weatherproof labels for an additional charge.\n\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -\nTHIS LABEL READS:\n\n(Groomsman&#39;s or Best Man&#39;s Name)\nWill you do me the honor of being my\nGroomsman or Best Man?\nWedding Location\nWedding Date\n\n* Wording can be changed for an additional fee\n\n- - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -\n\n\nHOW TO ORDER\n1. Add the item to you cart and proceed to checkout. \n\n2. At checkout please include the following details in the *NOTES TO SELLER* section:\n\n- Recipient&#39;s name and title\n- Wedding location and date\n\n3. We will send you a proof of your personalized designs within 3 business days of your order. Unless otherwise specified, we will send your proof to the email address on file with Etsy. \n\n4. Once approved, we will ship your order. IF YOU DO NOT RESPOND TO THE MESSAGE WITH YOUR PROOFS WITHIN 72 HOURS OF ME SENDING THEM I WILL PRINT AND MAIL! \n\nShipping:\nAll items will ship 1-2 business day after proof has been approved. Items are shipped via US Postal Service out of Lawrenceville, GA and are typically received within 2-5 business days from ship date. \n\n* IMPORTANT * - unless otherwise stated, items will ship to the address on file with Etsy. If you need us to ship to a different address, please make a note with purchase.\n\nFor quantities of 4 or more an additional discount will be given, please contact me for custom pricing.\n\n* Bottles not included\n\nWe declare no affiliation, sponsorship, nor any partnerships with any registered trademarks. This label is in no way affiliated, sponsored, or to be seen as a replica of Jack Daniels.\n\n*Images and text owned by other entities are the intellectual property of their respective owners. B&C Designs does not claim ownership over those rights. However, the conceptual designs and layouts of all designs is the original work of B&C Designs and is not to be reproduced and/or resold without permission. Only for personal use in the context of which it is sold*\n\nDue to the limitations of desktop scanners and the relative inconsistencies of various display monitors, the colors you see on your screen may not be a totally accurate reproduction of the actual product. We strive to make our colors as accurate as possible, but screen images are intended as a guide only and should not be regarded as absolutely correct.",
